import React from 'react';
import ReactDOM from 'react-dom';
import CommentDetail from './CommentDetail'


const App = () =>{
    return (
        <div className="ui container comments">
            <CommentDetail author="SAM" timeAgo="Today at 6:00 PM" about="Nice BLog Post" />
            <CommentDetail author="RAM" timeAgo="Today at 7:00 PM" about="Good Log Post" />
            <CommentDetail author="JAY" timeAgo="Today at 8:00 PM" about="Really BLog Post" />
        </div>
    );
}

ReactDOM.render(<App/>, document.querySelector('#root'));
